import react from "react";
import React from "react";


class Home extends react.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div class='homepage-container'>
                <HeaderBar />
            </div>
        );
    }
}


class HeaderBar extends react.Component {
    render() {
        return (
            <header class="navbar row d-flex">
                <nav>
                    <div class="col-2 navbar-left">
                        <h2>CONNECT</h2>
                    </div>
                    <div class="col-8 navbar-mid">
                        <form class="d-flex">
                            <input class="form-control search-bar" placeholder="Search" a />
                        </form>
                    </div>
                    <div class="col-2 navbar-right">
                        <img class="nav-icons" src="assets/notification.png" alt="icon-notif" />
                        <img class="nav-icons" src="assets/user.png" alt="icon-user" />
                    </div>
                </nav>
            </header>
        );
    }
}

export default Home;
